import {Component, OnInit, ViewChild, ElementRef} from '@angular/core';

import {ToastrService} from "ngx-toastr";


import {PaymentService} from "../shared/payment-service.service";
import {HttpErrorResponse} from "@angular/common/http";
import {ErrorObservable} from "rxjs/observable/ErrorObservable";
import {Router} from "@angular/router";
import {User} from "../shared/user";

declare var jsPDF: any;

@Component({
  selector: 'app-receipts',
  templateUrl: './receipts.component.html',
  styleUrls: ['./receipts.component.css']
})
export class ReceiptsComponent implements OnInit {


  private transactionId: string;

  private user = new User();

  showform: boolean;
  showdetails: boolean;
  loading = false;

  printShow :boolean;
  backShow :boolean;

  constructor(private paymentService: PaymentService, private toastrService: ToastrService, private router: Router) {
  }

  ngOnInit() {
    this.showform = true;
    this.showdetails = false;
    this.backShow = false;
    this.printShow = false;
  }

  back() {
    this.backShow = true;
    this.showform = true;
    this.showdetails = false;
    this.backShow = false;
  }

  print() {
    this.loading = true;
    this.paymentService.getPaymentDetailsWithStatus(this.transactionId).subscribe((user) => {
      if (user != null) {
        this.showform = false;
        this.showdetails = true;
        this.user = user;
        this.toastrService.success('Record Found Successfully', 'Done!!!');
        this.loading = false;
      } else {
        this.toastrService.error('Transaction ID not Found', 'Not Found!!!');
        this.loading = false;
      }


    }, (error: HttpErrorResponse) => {
      this.loading = false;
      if (error.error instanceof ErrorEvent) {
        // A client-side or network error occurred. Handle it accordingly.
        console.error('An error occurred:', error.error.message);
        this.toastrService.error('Network issue...Please try again later', 'Bad Network!!!');
      } else {
        // The backend returned an unsuccessful response code.
        // The response body may contain clues as to what went wrong,
        console.error(
          `Backend returned code ${error.status}, ` +
          `body was: ${error.error}`);
        this.toastrService.error('The Server is down...Please try again later', 'Failed!!!');
      }
      // return an ErrorObservable with a user-facing error message
      return new ErrorObservable(
        'Something bad happened; please try again later.');
    })
  }

  downloadPdf() {
    this.printShow = true;
    let imageData = 'data:image/jpeg;base64,';
    let doc = new jsPDF();
    doc.addImage(imageData, 'JPEG', 14, 0);
    let elem = document.getElementById("details");
    let res = doc.autoTableHtmlToJson(elem);
    doc.autoTable(res.columns, res.data, {startY: 50});
    //payments
    let element = document.getElementById("pays");
    let response = doc.autoTableHtmlToJson(element);
    doc.autoTable(response.columns, response.data, {startY: 150});

    doc.save(this.user.surname + '.pdf');
    this.printShow = false;
  }


}

